import React from 'react';

import { withFirebase } from '../Firebase';

import {
  DropdownItem,
  Card
} from "reactstrap";

notify = place => {
  var color = Math.floor(Math.random() * 5 + 1);
  var type;
  switch (color) {
    case 1:
      type = "primary";
      break;
    case 2:
      type = "success";
      break;
    case 3:
      type = "danger";
      break;
    case 4:
      type = "warning";
      break;
    case 5:
      type = "info";
      break;
    default:
      break;
  }
  var options = {};
  options = {
    place: place,
    message: (
      <div>
        <div>
          Welcome to <b>Black Dashboard React</b> - a beautiful premium admin
          for every web developer.
        </div>
      </div>
    ),
    type: type,
    icon: "tim-icons icon-bell-55",
    autoDismiss: 7
  };
  this.refs.notificationAlert.notificationAlert(options);
};

const SignOutButton = ({ firebase }) => (
  <DropdownItem className="nav-item" onClick={firebase.doSignOut}><a>Sign out</a></DropdownItem>
);

export default withFirebase(SignOutButton);
